import React from 'react';
import { StyledWrapper, ChekoutHeader, HeaderBlock } from './styles';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { selectCartItems,selectCountedItems } from '../../redux/cart/cart.selectors';

const CheckoutPage = ({ cartItems }) => {
	return (
		<StyledWrapper>
			<ChekoutHeader>
				<HeaderBlock>
					<span>Produkt</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Opis</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Ilość</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Cena</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Usuń</span>
				</HeaderBlock>
			</ChekoutHeader>
		</StyledWrapper>
	);
};

const mapStateToProps = createStructuredSelector({
    cartItems: selectCartItems,
    itemsPrice:selectCountedItems
});

export default connect(mapStateToProps)(CheckoutPage);
